import Head from 'next/head';
import styled from 'styled-components';

const NecesidadSection = styled.section`
	height: calc(100vh - 106px);
`;

export default function Home() {
	return (
		<>
			<Head>
				<title>Transparenta</title>
			</Head>
			<main className="container mx-auto">
				<NecesidadSection className="necesidad h-screen w-full flex flex-col items-center justify-center">
					<h1 className="text-5xl text-main font-bold w-full md:w-10/12  lg:w-6/12 bg-pink-100">
						Una necesidad actual
					</h1>
					<p className="text-5xl text-main font-bold w-full md:w-10/12  lg:w-6/12 bg-pink-100"></p>
				</NecesidadSection>
			</main>
		</>
	);
}
